  \"Eagle river flats bird dieoff: A summary of findings 1988\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:58.159591\",\n\t\"name\": \"eagle-river-flats-bird-dieoff-a-summary-of-findings-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Since 1982, periodic waterfowl die-offs
  have been documented at Ft. Richardson Army Base, Anchorage, Alaska in an area at
  the mouth of Eagle River known as Eagle River Flats (ERF). This study was part of
  an interagency effort organized to investigate the causes of these die-offs. In
  1988, U.S. Fish and Wildlife Service (Service) personnel from the Western Alaska
  Ecological Services, Anchorage Field Office (WAES) collected waterfowl at ERF to
  determine the presence of potentially lethal concentrations of metals, trace elements,
  aliphatic hydrocarbons (AH), polycyclic aromatic hydrocarbons (P AH), organochlorine
  pesticides (OC), and polychlorinated biphenyls (PCB). This report presents the results
  from these analyses, plus the results for separate OC analyses on two bald eagles
  (Haliaeetus leucocephalus) collected at ERF in 1985. A more detailed discussion
  of the results from the metal/trace element analyses is presented in an earlier
  draft report. The participation of WAES contaminant biologists in the investigation
  at ERF was interrupted in 1989 when the Exxon oil tanker, Valdez ran aground on
  Bligh Reef in Prince William Sound, Alaska. This catastrophe occupied the time of
  WAES personnel for several years, thus interfering with final reporting of this
  analytical data. During the hiatus, other researchers determined that ingestion
  of elemental (white) phosphorous (P4) was causing bird deaths at ERF (Racine, et.
  al., 1992, 1993) The U.S. Army has been using ERF as a firing range since the 1930s,
  and white phosphorous, a filler material in smoke rounds, is ubiquitous in certain
  areas. Discovery of the cause for waterfowl mortality at ERF made the results from
  this study obsolete. However, the results are presented here for the record, and
  to provide baseline information on contaminant concentrations in waterfowl and eagles
  in south-central Alaska.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
